import React, { useContext } from "react";
import { Context } from "../index";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Image from 'react-bootstrap/Image';
import {observer} from "mobx-react-lite";

const SetNav = observer(() => {
    const {user} = useContext(Context)
    if (user.isAuth){
        if (user.isAdmin){
            return(
                <Nav className="ml-auto" style={{fontWeight:  'bold', fontSize: 20}}>
                    <Nav.Link>Админ панель</Nav.Link>
                    <Nav.Link>Статьи</Nav.Link>
                    <Nav.Link>Пользователи</Nav.Link>
                    <Nav.Link>Выход</Nav.Link>
                </Nav>
            )
        }else{
            return(
                <Nav className="ml-auto" style={{fontWeight:  'bold', fontSize: 20}}>
                    <Nav.Link>Статьи</Nav.Link>
                    <Nav.Link>Пользователи</Nav.Link>
                    <Nav.Link>Выход</Nav.Link>
                </Nav>
            )
        }
    }else{
        return (
            <Nav className="ml-auto" style={{fontWeight:  'bold', fontSize: 20}}>
                <Nav.Link onClick={() => user.se}>Авторизация</Nav.Link>
            </Nav>
        )
    }
})

const NavBar = () => {
    return (
        <Navbar color="white">
            <Container>
                <Navbar.Brand>
                    <Image
                        src="./img/I.png"
                        alt="Business IT"
                        height= "85"
                        rounded 
                    />
                </Navbar.Brand>
                <SetNav />
            </Container>
      </Navbar>
    )
}


export default NavBar;
